import Icons from "./Icons";
export default function Task() {
  return (
    <div
      style={{
        padding: "10px",
        display: "flex",
        justifyContent: "space-between",
        alignItem: "center",
        backgroundColor: "#252F88",
        margin: "20px 0",
      }}
    >
      <div style={{ width: "25%" }}>
        <Icons />
      </div>
      <div style={{ color: "white", width: "90%" }}>
        <h3>زيد الخير الحداد</h3>
        <p></p>
      </div>
    </div>
  );
}
